import React from 'react';
import { Image, Table } from 'react-bootstrap';
import "./aboutme.css";

export const Info = () => (

    <Table>
        <tr>
            <td></td>
            <td><Image className="headshot" src="selfie1.jpg" rounded /></td>
            <td>
                <div class="text-center">
                    <a class="btn btn-primary btn-large" href="https://www.facebook.com/patrick.leduc.98?ref=bookmarks"> <i class="fab fa-facebook-square fa-2x"> </i> </a>
                    <a class="btn btn-primary btn-large" href="https://www.linkedin.com/in/patrick-leduc-1a1432102/"> <i class="fab fa-linkedin fa-2x"> </i> </a>
                    <a class="btn btn-primary btn-large" href="https://github.com/patrickl13"> <i class="fab fa-github fa-2x" style="width:29px;"> </i> </a>
                    <a class="btn btn-primary btn-large" href="https://www.instagram.com/patrickleduc13/?hl=en"> <i class="fab fa-instagram fa-2x"></i> </a>
                </div>
            </td>
            <td></td>
        </tr>
    </Table>

);
